import React from 'react';
import './Style.css';

let time = new Date().getDate;
let greeting = " ";
if(time >=7 && time <12){
    let greeting = " "
}

const Title = () => {
    return (
        <>
        <h4>{greeting}</h4>
        <div className='title'>
            <h1>Movies of the year</h1>
        </div>
        </>
    );
};


export default Title;
